const tourism = {
  spots: [
    { name: 'Caba Beachfront', description: 'Scenic shoreline ideal for sunrise walks.' },
    { name: 'Eco Park', description: 'Green space for family activities.' },
  ],
  products: [
    { name: 'Dried Fish', description: 'Locally made dried seafood products.' },
    { name: 'Handwoven Crafts', description: 'Artisanal woven items by local makers.' },
  ],
  heritage: [
    { name: 'Historic Church', description: 'A landmark reflecting the town\'s heritage.' },
    { name: 'Old Municipal Hall', description: 'A reminder of local governance history.' },
  ]
};

export default tourism;
